"use es6";

import React from "react";
import { ReactComponent as Stars } from "../images/stars.svg";
import { ReactComponent as Stripes } from "../images/stripes.svg";
import * as d3 from "d3";

const HomePage = () => {
  const canvasstyle = {
    width: "fit-content",
    height: "fit-content",
  };

  const stripesstyle = {
    backgroundColor: "#770000",
    backgroundImage:
      "url(https://www.economist.com/img/b/1280/720/90/sites/default/files/images/2021/09/articles/main/20210918_wbp501.jpg)",
    width: "fit-content",
    height: "fit-content",
    position: "absolute",
    top: "150px",
    left: "500px",
  };

  const borderstyle = {
    backgroundColor: "#ffffff",
    width: "fit-content",
    height: "fit-content",
    position: "absolute",
    top: "150px",
    left: "500px",
  };

  const starstyle = {
    backgroundColor: "#000077",
    backgroundImage:
      "url(https://lp-cms-production.imgix.net/2019-06/668f95c141607e7985b55a931c9d7049-north-america.jpg)",
    width: "fit-content",
    height: "fit-content",
    position: "absolute",
    top: "125px",
    left: "475px",
  };

  return (
    <>
      <div>
        <h1>HOME</h1>
        <div style={stripesstyle}>
          <Stripes />
        </div>
        {/* <div style={borderstyle}>
          <img src={stars} alt={"border"} />
        </div> */}
        <div style={starstyle}>
          <Stars />
        </div>
      </div>
    </>
  );
};

export default HomePage;
